import {BrowserRouter as Router, Route} from 'react-router-dom';

import HomePage from './Pages/HomePage'

import './App.css';

function App() {
  return (
    <Router>
      <div className="App">
        <Route path = "/" component = {HomePage} exact/> 
      </div>
    </Router>

  );
}

export default App;
